import styled from 'styled-components';

export const Wrapper = styled.div`
 .Dash {
   text-align: right;
   display: inlibe-block
 }

 nav {
    padding: 3px 16px;
    background-color: #292c2f;
 }

.navbar-brand{
 font-family: "Trebuchet MS", sans-serif;
 letter-spacing: -1px;
 font-size: 32px;
 margin-left: 50px;
 color: white;
}

p { 
color: white;
}
`;
